import React, { useState, useEffect } from 'react';
import { processInvoice } from '../services/api';
import HistoryPanel from './HistoryPanel';
import './InvoiceProcessor.css';

const InvoiceProcessor = () => {
  const [file, setFile] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [showHistory, setShowHistory] = useState(false);
  const [selectedHistoryNote, setSelectedHistoryNote] = useState(null);
  
  const [agentMessages, setAgentMessages] = useState([]);
  const [agentProcessing, setAgentProcessing] = useState(false);

  const handleFileChange = (e) => {
    setFile(e.target.files[0]);
    setError('');
    setResult(null);
    setAgentMessages([]);
  };

  const addAgentMessage = (message) => {
    setAgentMessages(prev => [...prev, {
      id: Date.now() + Math.random().toString(36).substr(2, 9),
      texto: message,
      timestamp: new Date()
    }]);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    
    if (!file) {
      setError('Por favor, selecione um arquivo PDF');
      return;
    }

    setLoading(true);
    setAgentProcessing(true);
    setError('');
    setResult(null);
    setAgentMessages([]);

    try {
      addAgentMessage('üöÄ Iniciando processamento da nota fiscal...');
      
      console.log('üì§ Enviando arquivo para backend...');
      const response = await processInvoice(file);
      
      console.log('=== üéØ DEBUG RADICAL - RESPONSE COMPLETO ===');
      console.log('RESPONSE:', response);
      console.log('Tipo do response:', typeof response);
      
      if (response) {
        console.log('üîç TODAS AS KEYS DO RESPONSE:', Object.keys(response));
        
        // DEBUG DETALHADO DE CADA PROPRIEDADE
        for (const key in response) {
          console.log(`--- PROPRIEDADE: ${key} ---`);
          console.log('Valor:', response[key]);
          console.log('Tipo:', typeof response[key]);
          
          if (response[key] && typeof response[key] === 'object') {
            console.log(`Keys de ${key}:`, Object.keys(response[key]));
            
            // Verificar propriedades aninhadas
            if (response[key].dadosNota) {
              console.log(`‚úÖ ${key}.dadosNota:`, response[key].dadosNota);
            }
            if (response[key].data) {
              console.log(`‚úÖ ${key}.data:`, response[key].data);
            }
            if (response[key].fornecedor) {
              console.log(`‚úÖ ${key}.fornecedor:`, response[key].fornecedor);
            }
            if (response[key].valorTotal) {
              console.log(`‚úÖ ${key}.valorTotal:`, response[key].valorTotal);
            }
          }
        }
        
        // VERIFICAR SE H√Å DADOS DIRETAMENTE NO RESPONSE
        console.log('üîç Verificando dados diretamente no response:');
        console.log('- response.fornecedor:', response.fornecedor);
        console.log('- response.cliente:', response.cliente);
        console.log('- response.numeroNotaFiscal:', response.numeroNotaFiscal);
        console.log('- response.valorTotal:', response.valorTotal);
        console.log('- response.produtos:', response.produtos);
      }
      console.log('=== FIM DEBUG RADICAL ===');

      // Processar mensagens do agente
      if (response.processamento && response.processamento.mensagens) {
        console.log('üì® Mensagens do agente:', response.processamento.mensagens);
        setAgentMessages(response.processamento.mensagens);
      }

      if (response.success) {
        // CORRE√á√ÉO: VERIFICAR SE O PR√ìPRIO RESPONSE √â OS DADOS
        console.log('üîç Analisando estrutura para encontrar dados...');
        
        let dadosParaExibir = null;
        let fonte = '';
        
        // ESTRAT√âGIA 1: Verificar se o response tem dados diretamente
        if (response.fornecedor || response.valorTotal || response.numeroNotaFiscal) {
          console.log('‚úÖ Dados encontrados DIRETAMENTE no response');
          dadosParaExibir = response;
          fonte = 'response direto';
        }
        // ESTRAT√âGIA 2: Verificar response.data
        else if (response.data && typeof response.data === 'object') {
          console.log('‚úÖ Dados encontrados em response.data');
          dadosParaExibir = response.data;
          fonte = 'response.data';
        }
        // ESTRAT√âGIA 3: Verificar response.dadosNota
        else if (response.dadosNota && typeof response.dadosNota === 'object') {
          console.log('‚úÖ Dados encontrados em response.dadosNota');
          dadosParaExibir = response.dadosNota;
          fonte = 'response.dadosNota';
        }
        // ESTRAT√âGIA 4: Verificar processamento.dadosNota
        else if (response.processamento?.dadosNota) {
          console.log('‚úÖ Dados encontrados em processamento.dadosNota');
          dadosParaExibir = response.processamento.dadosNota;
          fonte = 'processamento.dadosNota';
        }
        // ESTRAT√âGIA 5: Verificar se processamento tem dados
        else if (response.processamento && 
                (response.processamento.fornecedor || response.processamento.valorTotal)) {
          console.log('‚úÖ Dados encontrados no processamento');
          dadosParaExibir = response.processamento;
          fonte = 'processamento';
        }
        // ESTRAT√âGIA 6: Tentar usar qualquer objeto que tenha dados
        else {
          console.log('üîç Buscando dados em qualquer propriedade...');
          for (const key in response) {
            const value = response[key];
            if (value && typeof value === 'object') {
              if (value.fornecedor || value.valorTotal || value.numeroNotaFiscal) {
                console.log(`‚úÖ Dados encontrados em response.${key}`);
                dadosParaExibir = value;
                fonte = `response.${key}`;
                break;
              }
            }
          }
        }
        
        console.log('üéØ Resultado da busca:', { dadosParaExibir, fonte });
        
        if (dadosParaExibir) {
          // CORRE√á√ÉO: Criar estrutura garantida
          const resultData = {
            success: true,
            data: dadosParaExibir,
            processamento: response.processamento,
            metadata: {
              fileName: file.name,
              processedAt: new Date().toISOString(),
              fonteDados: fonte
            }
          };
          
          console.log('‚úÖ Estrutura final do result:', resultData);
          setResult(resultData);
          addAgentMessage('‚úÖ Processamento conclu√≠do com sucesso!');
          addAgentMessage(`üìä Dados extra√≠dos de: ${fonte}`);
        } else {
          // SE NADA FUNCIONAR, TENTAR USAR O RESPONSE COMPLETO
          console.log('‚ö†Ô∏è Nenhum dado estruturado encontrado, usando response completo');
          const resultData = {
            success: true,
            data: response, // Usar o response completo
            processamento: response.processamento,
            metadata: {
              fileName: file.name,
              processedAt: new Date().toISOString(),
              fonteDados: 'response completo (fallback)'
            }
          };
          
          console.log('‚úÖ Usando fallback:', resultData);
          setResult(resultData);
          addAgentMessage('‚úÖ Processamento conclu√≠do (modo fallback)');
        }
      } else {
        setError(response?.error || 'Erro desconhecido no processamento');
        addAgentMessage('‚ùå Erro no processamento');
      }
      
    } catch (err) {
      console.error('üí• Erro no frontend:', err);
      setError('Erro ao processar o arquivo');
      addAgentMessage('‚ùå Erro de comunica√ß√£o com o servidor');
    } finally {
      setLoading(false);
      setAgentProcessing(false);
    }
  };

  // Componente para exibir mensagens do agente
  const AgentMessagesPanel = () => {
    if (agentMessages.length === 0 && !agentProcessing) {
      return null;
    }

    return (
      <div className="agent-messages-panel">
        <h3>ü§ñ Agente Inteligente - Processamento</h3>
        <div className="agent-messages-container">
          {agentMessages.map((message, index) => {
            const uniqueKey = message.id ? `${message.id}_${index}` : `msg_${index}`;
            const messageText = message?.texto || '';
            const isError = messageText.includes('‚ùå') || messageText.toLowerCase().includes('erro');
            const isSuccess = messageText.includes('‚úÖ') || messageText.toLowerCase().includes('sucesso');
            
            return (
              <div 
                key={uniqueKey}
                className={`agent-message ${isError ? 'error' : ''} ${isSuccess ? 'success' : ''}`}
              >
                <span className="agent-message-time">
                  {message.timestamp ? new Date(message.timestamp).toLocaleTimeString() : new Date().toLocaleTimeString()}
                </span>
                <div className="agent-message-text">
                  {messageText.split('\n').map((line, lineIndex) => (
                    <div key={`${uniqueKey}_line_${lineIndex}`}>{line}</div>
                  ))}
                </div>
              </div>
            );
          })}
          
          {agentProcessing && agentMessages.length === 0 && (
            <div className="agent-message" key="processing_initial">
              <span className="agent-message-time">{new Date().toLocaleTimeString()}</span>
              <div className="agent-message-text">‚è≥ Iniciando processamento...</div>
            </div>
          )}
          
          {agentProcessing && (
            <div className="agent-processing-indicator" key="processing_indicator">
              <div className="agent-spinner"></div>
              <span>Processando com Agente Inteligente...</span>
            </div>
          )}
        </div>
      </div>
    );
  };

  // Fun√ß√µes de formata√ß√£o
  const formatCurrency = (value) => {
    if (!value && value !== 0) return 'R$ 0,00';
    return new Intl.NumberFormat('pt-BR', {
      style: 'currency',
      currency: 'BRL'
    }).format(value);
  };

  const formatCNPJ = (cnpj) => {
    if (!cnpj || cnpj === 'N/A' || cnpj === '') return 'N/A';
    const cleaned = cnpj.replace(/\D/g, '');
    if (cleaned.length !== 14) return cnpj;
    return cleaned.replace(/(\d{2})(\d{3})(\d{3})(\d{4})(\d{2})/, '$1.$2.$3/$4-$5');
  };

  const formatCPF = (cpf) => {
    if (!cpf || cpf === 'N/A' || cpf === '') return 'N/A';
    const cleaned = cpf.replace(/\D/g, '');
    if (cleaned.length !== 11) return cpf;
    return cleaned.replace(/(\d{3})(\d{3})(\d{3})(\d{2})/, '$1.$2.$3-$4');
  };

  const formatEndereco = (endereco) => {
    if (!endereco || endereco === 'N/A' || endereco === '') return 'N/A';
    return endereco;
  };

  // RENDERIZA√á√ÉO QUE FUNCIONA COM QUALQUER ESTRUTURA
  const renderData = () => {
    if (!result || !result.data) {
      return (
        <div className="error-message">
          <h3>‚ùå Nenhum dado dispon√≠vel</h3>
          <p>O processamento foi conclu√≠do, mas nenhum dado foi recebido para exibi√ß√£o.</p>
        </div>
      );
    }

    console.log('üéØ Renderizando com result.data:', result.data);

    // CORRE√á√ÉO: Fun√ß√£o para extrair dados de qualquer estrutura
    const extractField = (fieldName) => {
      const data = result.data;
      
      // Tentar diferentes caminhos
      const paths = [
        data[fieldName],
        data?.dadosNota?.[fieldName],
        data?.data?.[fieldName],
        data?.notaFiscal?.[fieldName],
        data?.processamento?.[fieldName]
      ];
      
      for (const value of paths) {
        if (value !== undefined && value !== null) {
          return value;
        }
      }
      return null;
    };

    // Extrair dados
    const fornecedor = extractField('fornecedor');
    const cliente = extractField('cliente') || extractField('faturado');
    const numeroNotaFiscal = extractField('numeroNotaFiscal');
    const dataEmissao = extractField('dataEmissao');
    const valorTotal = extractField('valorTotal');
    const produtos = extractField('produtos');
    const parcelas = extractField('parcelas');
    const classificacaoDespesa = extractField('classificacaoDespesa');

    console.log('üìä Dados extra√≠dos:');
    console.log('- Fornecedor:', fornecedor);
    console.log('- Cliente:', cliente);
    console.log('- N√∫mero NF:', numeroNotaFiscal);
    console.log('- Valor Total:', valorTotal);

    return (
      <div className="result-container">
        <h2>üìÑ Dados Extra√≠dos da Nota Fiscal</h2>
        
        {/* INFO DA FONTE */}
        {result.metadata?.fonteDados && (
          <div style={{
            background: '#e8f5e8', 
            padding: '10px', 
            margin: '10px 0', 
            border: '2px solid #4caf50',
            borderRadius: '8px'
          }}>
            <strong>‚úÖ DADOS ENCONTRADOS!</strong> (Fonte: {result.metadata.fonteDados})
          </div>
        )}

        {/* Informa√ß√µes B√°sicas */}
        <div className="summary-section">
          <h3>üìã Informa√ß√µes da Nota</h3>
          <div className="summary-grid">
            <div className="summary-item">
              <span className="summary-label">N√∫mero NF:</span>
              <span className="summary-value">{numeroNotaFiscal || 'N/A'}</span>
            </div>
            <div className="summary-item">
              <span className="summary-label">Data Emiss√£o:</span>
              <span className="summary-value">{dataEmissao || 'N/A'}</span>
            </div>
            <div className="summary-item">
              <span className="summary-label">Valor Total:</span>
              <span className="summary-value">{formatCurrency(valorTotal)}</span>
            </div>
            {result.processamento?.idMovimento && (
              <div className="summary-item">
                <span className="summary-label">ID Movimento:</span>
                <span className="summary-value" style={{color: '#4caf50', fontWeight: 'bold'}}>
                  #{result.processamento.idMovimento}
                </span>
              </div>
            )}
          </div>
        </div>

        {/* Fornecedor */}
        {fornecedor && (
          <div className="supplier-section">
            <h3>üè¢ Fornecedor</h3>
            <div className="supplier-info">
              <p><strong>Raz√£o Social:</strong> <span className="info-value">{fornecedor.razaoSocial || 'N/A'}</span></p>
              <p><strong>CNPJ:</strong> <span className="info-value">{formatCNPJ(fornecedor.cnpj)}</span></p>
            </div>
          </div>
        )}

        {/* Cliente */}
        {cliente && (
          <div className="client-section">
            <h3>üë§ Cliente</h3>
            <div className="client-info">
              <p><strong>Nome:</strong> <span className="info-value">{cliente.nome || cliente.nomeCompleto || 'N/A'}</span></p>
              <p><strong>Documento:</strong> <span className="info-value">
                {cliente.cpf ? formatCPF(cliente.cpf) : 
                 cliente.cnpj ? formatCNPJ(cliente.cnpj) :
                 cliente.documento || 'N/A'}
              </span></p>
            </div>
          </div>
        )}

        {/* JSON Completo para Debug */}
        <details className="json-details">
          <summary>üîß JSON Completo Recebido (Debug)</summary>
          <pre className="result-json">
            {JSON.stringify(result.data, null, 2)}
          </pre>
        </details>
      </div>
    );
  };

  const handleShowHistory = () => {
    setShowHistory(true);
  };

  const handleCloseHistory = () => {
    setShowHistory(false);
    setSelectedHistoryNote(null);
  };

  const handleSelectHistoryNote = (noteData) => {
    setSelectedHistoryNote(noteData);
    setShowHistory(false);
    if (noteData && noteData.data) {
      setResult({
        success: true,
        data: noteData.data,
        metadata: {
          fileName: noteData.originalFileName,
          processedAt: noteData.processedAt,
          fromHistory: true
        }
      });
    }
  };

  return (
    <div className="invoice-processor">
      <h1>LSR - NF</h1>
      <p>Fa√ßa upload de uma nota fiscal em PDF para extrair os dados automaticamente</p>
      
      <div className="history-button-container">
        <button 
          type="button"
          onClick={handleShowHistory}
          className="history-button"
        >
          üìã Ver Hist√≥rico
        </button>
      </div>
      
      <form onSubmit={handleSubmit} className="upload-form">
        <div className="file-input-container">
          <input
            type="file"
            accept=".pdf"
            onChange={handleFileChange}
            className="file-input"
            id="pdfFile"
          />
          <label htmlFor="pdfFile" className="file-label">
            {file ? file.name : 'Selecionar PDF'}
          </label>
        </div>
        
        <button 
          type="submit" 
          disabled={loading || !file}
          className="process-button"
        >
          {loading ? 'Processando...' : 'Extrair Dados'}
        </button>
      </form>

      <AgentMessagesPanel />

      {error && (
        <div className="error-message">
          {error}
        </div>
      )}

      {/* Renderiza√ß√£o dos dados */}
      {result && result.success && renderData()}

      <HistoryPanel 
        isOpen={showHistory}
        onClose={handleCloseHistory}
        onSelectNote={handleSelectHistoryNote}
      />
    </div>
  );
};

export default InvoiceProcessor;
